import React, { Component } from 'react';

class JSONcontainer extends Component {
    render() {
        let wireframe = this.props.wireframe;
        let controls = wireframe.controls
        return(
            <div id="JSONcontainer" className="white container" style={{height: wireframe.container.height/10, width: wireframe.container.width/10,}}>
                {controls && controls.map((controls) => {
                    if(controls.type === "label"){
                        console.log(controls.text);
                        return (<div id="label" className="btn-large-flat" style={{textAlign: "center", 
                            background: controls.background, 
                            borderColor: controls.bordercolor,
                            borderWidth: controls.borderwidth/10,
                            fontSize: controls.fontSize/10,
                            height: controls.height/10,
                            width: controls.width/10,
                            marginTop: controls.top/10,
                            marginLeft: controls.left/10,
                            }}>{controls.text}</div>)
                    }
                })}
            </div>
        )
    }
}

export default (JSONcontainer)
